import React from 'react';
import handleTyping from '../helpers/handleTyping'

const Search = ({newSearch,  setNewSearch}) =>{
    return(
      <div>
        Search: <input value={newSearch} onChange={(e) => handleTyping(setNewSearch, e)}/>
      </div>
    )
}

export default Search
